{noformat}package voltron

import (
	"github.com/generacclean/factorycommon/hal/load/youngen"
	"go.uber.org/zap"
)

const (
	RlcIP = "10.11.70.19"
)

// SetupYoungenRLC will configure the RLC load bank and enable its output.
// It returns the configured RLC load bank and an error if any occurs.
func SetupYoungenRLC(wattsL1 uint16, wattsL2 uint16, cVarsL1 uint16, cVarsL2 uint16,
	lVarsL1 uint16, lVarsL2 uint16, logger *zap.Logger) (*youngen.YoungenLoad, error) {
	logger.Info("configuring_rlc_load_bank")

	// Initialize the RLC load bank client.
	var rlc youngen.YoungenLoad
	rlc = youngen.NewYoungenLoad(RlcIP)

	var err error
	// Configure the RLC load bank with various loads
	if err = rlc.SetLineOneResistiveLoad(wattsL1); err != nil {
		return nil, err
	}

	if err = rlc.SetLineTwoResistiveLoad(wattsL2); err != nil {
		return nil, err
	}

	if err = rlc.SetLineOneCapacitiveLoad(cVarsL1); err != nil {
		return nil, err
	}

	if err = rlc.SetLineTwoCapacitiveLoad(cVarsL2); err != nil {
		return nil, err
	}

	if err = rlc.SetLineOneInductiveLoad(lVarsL1); err != nil {
		return nil, err
	}

	if err = rlc.SetLineTwoInductiveLoad(lVarsL2); err != nil {
		return nil, err
	}

	logger.Info("enabling_rlc_load_bank_output")

	// Enable the RLC load bank output
	if err = rlc.TurnOn(); err != nil {
		return nil, err
	}

	return &rlc, nil
}

// CloseYoungenClient will close the connection with Yungen RLC load bank.
func CloseYoungenClient(rlc *youngen.YoungenLoad, logger *zap.Logger) error {
	logger.Info("closing_connection_with_rlc_load_bank")

	var err error
	if err = rlc.TurnOff(); err != nil {
		return err
	}

	return nil
}
{noformat}
